import React from "react";
import Image from "next/image";
import img1 from "@/public/1.jpg";
const ImageItem = () => {
  return (
    <div>
      <h2>IMAGES</h2>
      <Image
        src={img1} // With placeholder the image path must be static now dynamic
        alt="images.jpg"
        width={280}
        height={120}
        placeholder="blur" // Now blurred image will load fast
      />
      <hr/>
      {[1, 2, 3, 4, 5].map((item, i) => {
        return (
          //   <img src={`${item}.jpg`} alt="images.jpg" width={280} height={120} key={i}/>
          <Image
            src={`/${item}.jpg`}
            alt="images.jpg"
            width={500}
            height={400}
            key={i}
            placeholder="blur"
            blurDataURL={blurString} // As image path is dynamic so have to use blurDataURL to display base45 string image as a placeholder
          />
        );
      })}
    </div>
  );
};

export default ImageItem;

// Here we are showing 5 images of large resolution using native img tag but here when we load the page it takes to much time to render on the ui so we will use Image Component for optimization.

// Using Image component of nextJS now the page will load faster in ui as now nextJS will create a seperate cache folder that contains optimized webp format of images of small in size. 2nd advantage is lazy loading as images which are not currently visible in viewport will not load untill they appear in viewport. 3rd advantage is we can also render a placeholder blurred image while actual image is getting loaded in browser that serves the purpose of skeleton loading for images using placeholder prop. But in order to use placeholder image the src path need to be static that is we can not use dynamic path value but if we have to then pass another props called blurDataURL

const blurString =
  "data:image/png;base64,";
